import React from "react";
import { Routes, Route, Outlet } from "react-router-dom"; // Thêm Outlet
import 'bootstrap/dist/css/bootstrap.min.css';

// Layouts
import Header from "./layouts/Header";
import Footer from "./layouts/Footer";
import Main from "./layouts/Main";

// Pages User
import Login from "./pages/auth/Login";
import Register from "./pages/auth/Register";
import ForgotPassword from "./pages/auth/ForgotPassword";
import ProductList from "./pages/product/ProductList";
import ProductDetail from "./pages/product/ProductDetail";
import ProductCart from "./pages/cart/ProductCart";
import Checkout from "./pages/order/CheckOut";
import OrderList from "./pages/order/OrderList";

// Admin
import AdminRoute from "./routes/AdminRoute";
import AdminLayout from "./pages/admin/AdminLayout";
import AdminDashboard from "./pages/admin/Dashboard";
import AdminLogin from "./pages/admin/AdminLogin";
import ProductListAD from "./pages/admin/products/ProductListAD";
import CategoryListAD from "./pages/admin/categories/CategoryListAD";
// Thành phần Layout cho User để tái sử dụng Header/Footer
const UserLayout = () => (
  <>
    <Header />
    <div style={{ minHeight: "80vh" }}>
      <Outlet /> {/* Nơi các trang con như Login, ProductList... hiển thị */}
    </div>
    <Footer />
  </>
);

function App() {
  return (
    <Routes>
      {/* 1. TRANG LOGIN ADMIN: Đứng một mình, không dính Header/Footer */}
      <Route path="/admin/login" element={<AdminLogin />} />

      {/* 2. GIAO DIỆN ADMIN: Bảo vệ bởi AdminRoute và có Layout riêng */}
      <Route
        path="/admin"
        element={
          <AdminRoute>
            <AdminLayout />
          </AdminRoute>
        }
      >
        <Route index element={<AdminDashboard />} />
        <Route path="products" element={<ProductListAD />} />
        <Route path="categories" element={<CategoryListAD />} />
      </Route>

      {/* 3. GIAO DIỆN USER: Tất cả các trang này sẽ có Header và Footer */}
      <Route path="/" element={<UserLayout />}>
        <Route index element={<Main />} />
        <Route path="login" element={<Login />} />
        <Route path="register" element={<Register />} />
        <Route path="forgot-password" element={<ForgotPassword />} />
        <Route path="product" element={<ProductList />} />
        <Route path="product/:productId" element={<ProductDetail />} />
        <Route path="cart" element={<ProductCart />} />
        <Route path="checkout" element={<Checkout />} />
        <Route path="orders" element={<OrderList />} />
        <Route path="*" element={<h2 className="text-center mt-4">404 - Trang không tồn tại</h2>} />
      </Route>
    </Routes>
  );
}

export default App;
